@import 'var';

@mixin full{
  left: 0;
  right: 0;
  bottom: 0;
  top: 0;
}

// 占位文本颜色
@mixin placeholder($color: $b-second) {
  &::placeholder {
    color: $color;
  }
}

// 超出隐藏
@mixin ellipsis-x($row-num: 1) {
  @if $row-num!=1 {
    overflow: hidden;
    display: -webkit-box;
    -webkit-line-clamp: $row-num;
    -webkit-box-orient: vertical;
  } @else {
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
  }
}

// 清除浮动
@mixin clearfix() {
  &::after {
    content: '';
    display: table;
    clear: both;
  }
}

// size
@mixin size($size) {
  width: $size;
  height: $size;
}

@mixin wh($width, $height) {
  width: $width;
  height: $height;
}

// 以设计图的尺寸的1/10计算rem值
@function rem($px) {
  @return $px / $design-width * 10 + rem;
}

@function px($px) {
  @return $px / $dpr + px;
}

// 元素状态背景色
@mixin status-bg {

  &.__red {
    background-color: $color-error;
  }

  &.__blue {
    background-color: $color-info;
  }

  &.__yellow {
    background-color: $color-warn;
  }

  &.__green {
    background-color: $color-success;
  }
}

// 元素状态边框色
@mixin status-bg {

  &.__red {
    border-color: $color-error;
  }

  &.__blue {
    border-color: $color-info;
  }

  &.__yellow {
    border-color: $color-warn;
  }

  &.__green {
    border-color: $color-success;
  }
}

// effect */
@mixin effect-shadow {
  cursor: pointer;
  box-shadow: $shadow-1;
  transition: box-shadow $animation-duration-base;

  &:hover {
    box-shadow: $shadow-2;
  }

  &:active {
    transition: box-shadow $animation-duration-base 0.1s;
    box-shadow: $shadow-1-focus;
  }
}

@mixin effect-bg() {
  cursor: pointer;
  transition: background-color $animation-duration-base;

  &:hover {
    background-color: $b-divider;
    background-color: var(--m78-color-divider);
  }

  &:active {
    transition: background-color $animation-duration-base 0.1s;
    background-color: $b-border;
    background-color: var(--m78-color-border);
  }
}

@mixin effect-border($c: $color) {
  cursor: pointer;
  transition: border $animation-duration-base;
  border: 1px solid transparent;

  &:hover {
    border: 1px solid $c;
  }

  &:active {
    transition: border $animation-duration-base 0.1s;
    border: 1px solid scale-color($c, $lightness: -30%);
  }
}

@mixin effect-opacity() {
  cursor: pointer;
  transition: opacity $animation-duration-base;

  &:hover {
    opacity: 0.8;
  }

  &:active {
    transition: opacity $animation-duration-base 0.1s;
    opacity: 0.7;
  }
}

@mixin effect-scale() {
  cursor: pointer;
  transition: transform $animation-duration-base;

  &:hover {
    transform: scale3d(1.1, 1.1, 1.1);
  }

  &:active {
    transition: transform $animation-duration-base 0.1s;
    transform: scale3d(1.05, 1.05, 1.05);
  }
}

@mixin effect-font-color($c: $color) {
  cursor: pointer;
  color: $c;
  transition: transform $animation-duration-base;


  &:hover {
    color: scale-color($c, $lightness: -20%);
  }

  &:active {
    transition: transform $animation-duration-base 0.1s;
    color: scale-color($c, $lightness: -40%);
  }
}

