@import '../var/index';

// --------------------- 可见 ---------------------
.hide {
  display: none !important;
}

.show {
  display: block !important;
}

.visible {
  visibility: visible !important;
}

.hidden {
  visibility: hidden !important;
}

.opacity-0 {
  opacity: 0 !important;
}

.opacity-1 {
  opacity: 1 !important;
}

// --------------------- 布局 ---------------------
.float-right {
  float: right !important;
}

.float-left {
  float: left !important;
}

.clearfix {
  @include clearfix;
}

.center-block {
  display: block !important;
  margin-left: auto !important;
  margin-right: auto !important;
}

.psr {
  position: relative !important;
}

.psa {
  position: absolute !important;
}

// 微调位置
.move-t1 {
  position: relative;
  top: -1px !important;
}

.move-t2 {
  position: relative;
  top: -2px !important;
}

.move-t3 {
  position: relative;
  top: -3px !important;
}

.move-b1 {
  position: relative;
  bottom: -1px !important;
}

.move-b2 {
  position: relative;
  bottom: -2px !important;
}

.move-b3 {
  position: relative;
  bottom: -3px !important;
}

// --------------------- 颜色 ---------------------
.color-red {
  color: $red-6 !important;
}

.color-orange {
  color: $orange-6 !important;
}

.color-yellow {
  color: $yellow-6 !important;
}

.color-green {
  color: $green-6 !important;
}

.color-cyan {
  color: $cyan-6 !important;
}

.color-blue {
  color: $blue-6 !important;
}

.color-purple {
  color: $purple-6 !important;
}

.bg-red {
  background-color: $red-6 !important;
}

.bg-orange {
  background-color: $orange-6 !important;
}

.bg-yellow {
  background-color: $yellow-6 !important;
}

.bg-green {
  background-color: $green-6 !important;
}

.bg-cyan {
  background-color: $cyan-6 !important;
}

.bg-blue {
  background-color: $blue-6 !important;
}

.bg-purple {
  background-color: $purple-6 !important;
}


// --------------------- 尺寸 --------------------- //

.h-1em {
  height: 1em !important;
}

.h-0d8em {
  height: 0.8em !important;
}

.h-1d2em {
  height: 1.2em !important;
}

.h-1d4em {
  height: 1.4em !important;
}

.w-fifth {
  width: 20% !important;
}

.w-fourth {
  width: 25% !important;
}

.w-third {
  width: 33.3333% !important;
}

.w-half {
  width: 50% !important;
}

.w-full {
  width: 100% !important;
}

.w-1em {
  width: 1em !important;
}

.w-0d8em {
  width: 0.8em !important;
}

.w-1d2em {
  width: 1.2em !important;
}

.w-1d4em {
  width: 1.4em !important;
}

// --------------------- 文字 --------------------- //
// 性质
.ellipsis {
  @include ellipsis-x;
}

.ellipsis-2 {
  @include ellipsis-x(2);
}

.fw {
  font-weight: $fw !important;
}

.fw-md {
  font-weight: $fw-md !important;
}

.fw-lg {
  font-weight: $fw-lg !important;
}

.lh-0 {
  line-height: 0 !important;
}

.lh-1 {
  line-height: 1 !important;
}

.lh-base {
  line-height: $line-height-base !important;
}

.lh-2 {
  line-height: 2 !important;
}

.bold {
  font-weight: bold !important;
}

.tl {
  text-align: left !important;
}

.tc {
  text-align: center !important;
}

.tr {
  text-align: right !important;
}

.vm {
  vertical-align: middle !important;
}

.vt {
  vertical-align: top !important;
