// -------------------- 小型组件 -------------------- //

.m78-dot {
  display: inline-block;
  width: 5px;
  height: 5px;
  background-color: $b-disable;
  background-color: var(--m78-color-disable);
  border-radius: 50%;
  vertical-align: middle;
  margin-right: 4px;
  @include status-bg;
}


.m78-triangle {
  display: inline-block;
  vertical-align: middle;
  width: 0;
  height: 0;
  border: 5px solid transparent;
  border-left: 5px solid $b-second;
  border-left: 5px solid var(--m78-color-second);
  border-radius: 2px;
}


// --------------------- 动画 --------------------- //
.#{$prefix}-animated-spin {
  transform-origin: center center;
  animation: #{$prefix}-spin 2s infinite linear;
}

.#{$prefix}-animated-steps {
  animation: #{$prefix}-spin 1s infinite steps(8);
}

@keyframes #{$prefix}-spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

// --------------------- 遮罩 --------------------- //
.m78-mask {
  position: fixed;
  background-color: $w-mask;
  background-color: var(--m78-mask);
  z-index: $z-index;
  @include full;
}

.m78-mask-b {
  position: fixed;
  background-color: $b-mask;
  z-index: $z-index;
  @include full;
}

// --------------------- 图片 --------------------- //
// 圆形图片
.circle-img {
  border-radius: 50%;
  border: 1px solid $b-border;
  border: 1px solid var(--m78-color-border);
  overflow: hidden;
}

// --------------------- 边框 --------------------- //
.border {
  border: 1px solid $b-border;
  border: 1px solid var(--m78-color-border);
}

// 1px 线 //
.m78-hb-t {
  &:before {
    position: absolute;
    content: '';
    height: 1px;
    top: 0;
    left: 0;
    right: 0;
    background-color: $b-border;
    background-color: 1px solid var(--m78-color-border);
    transform: scaleY(0.5);
  }
}

.m78-hb-b {
  &:after {
    position: absolute;
    content: '';
    height: 1px;
    left: 0;
    right: 0;
    bottom: 0;
    background-color: $b-border;
    background-color: 1px solid var(--m78-color-border);
    transform: scaleY(0.5);
  }
}

// --------------------- 交互 ---------------------

.no-select {
  user-select: none;
}

// 扩大交互区
.expand {
  position: relative;

  &::before {
    content: '';
    position: absolute;
    left: -30%;
    top: -30%;
    right: -30%;
    bottom: -30%;
  }
}

.effect-shadow {
  @include effect-shadow;
}

.effect-bg {
  @include effect-bg;
}

.effect-border {
  @include effect-border;
}

.effect-opacity {
  @include effect-opacity;
}

.effect-scale {
  @include effect-scale;
}

.effect-font-color {
  @include effect-font-color;
}

.cus-p {
  cursor: pointer;
}

.cus-na {
  cursor: not-allowed;
}

// --------------------- 其他 ---------------------
// 防止文字与背景同色
.m78-stress {
  text-shadow: $stress-shadow-b;
}

@supports (mix-blend-mode: difference) {
  .m78-stress {
    mix-blend-mode: difference;
    text-shadow: none;
  }
}

