@import "../var/index";

.m78-column {
  position: relative;
  display: flex;
  flex-direction: column;
}

.m78-row {
  position: relative;
  display: flex;
  flex-direction: row;
}

// 对齐 ***/
.m78-main-center {
  justify-content: center;
}

.m78-main-start {
  justify-content: flex-start;
}

.m78-main-end {
  justify-content: flex-end;
}

.m78-main-around  {
  justify-content: space-around;
}

.m78-main-between  {
  justify-content: space-between;
}

.m78-main-evenly  {
  justify-content: space-evenly;
}

.m78-cross-stretch {
  align-items: stretch;
}

.m78-cross-start {
  align-items: flex-start;
}

.m78-cross-end {
  align-items: flex-end;
}

.m78-cross-center {
  align-items: center;
}

.m78-self-center {
  align-self: center;
}

.m78-self-stretch {
  align-self: stretch;
}

.m78-self-start {
  align-self: flex-start;
}

.m78-self-end {
  align-self: flex-end;
}


// 值类 ***/

.m78-order-minus1 {
  order: -1
}

.m78-order-1 {
  order: 1
}

.m78-order-2 {
  order: 2
}

.m78-order-3 {
  order: 3
}

.m78-order-4 {
  order: 4
}

.m78-order-5 {
  order: 5
}

.m78-flex-1 {
  flex: 1
}

.m78-flex-2 {
  flex: 2
}

.m78-flex-3 {
  flex: 3
}

.m78-flex-4 {
  flex: 4
}

.m78-flex-5 {
  flex: 5
}

.m78-divider {
  background-color: rgba(0, 0, 0, 0.15);
  height: 0.5px;
  width: 100%;
  margin: 12px 0;

  &.__vertical {
    display: inline-block;
    vertical-align: middle;
    height: 1.2em;
    width: 0.5px;
    margin: 0 12px;
  }
}

.m78-center {
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
}

.m78-aspect-ratio {
  position: relative;
  display: inline-block;
  vertical-align: top;
  width: 100%;

  &_scaffold {
    float: left;
    padding-top: 100%;
    visibility: hidden;
  }
}

.m78-tile {
  &_leading {
    flex: 0 0 auto;
    margin-right: 10px;
  }

  &_main {
    flex: 1;
    overflow: hidden;
  }

  &_trailing {
    flex: 0 0 auto;
    margin-left: 10px;
  }
}

